import React, { useEffect } from 'react'
import { useSelector } from 'react-redux'
import { getAPI } from '../../apis/Axios'

const Post = () => {
    const auth = useSelector(state=>state.auth);

    useEffect(async ()=>{
        const res = await getAPI('post', auth.token);
        console.log(res.data);
    },[])

    return (
        <div>
            POST DAY
        </div>
    )
}

export default Post
